import React from 'react';

const StatusMessage = ({ message }) => {
  if (!message) return null;

  return (
    <div
      className={`alert ${
        message.startsWith('Error') ? 'alert-danger' : 'alert-success'
      }`}
      role="alert"
    >
      {message}
    </div>
  );
};

export default StatusMessage;
